			<div className={"post"}>
		      <h3>{this.props.text}</h3>
		      <small>{this.props.time}</small>
			      <div style={likeLine}>
			      <p>Likes: 100 </p>
				      <button style={{'backgroundColor': 'blue' ,
				      'color':'White' ,
				      'fonteSize':16,
				      'border':'none',
				      'borderRadius':'10'	
			  		}}> Like </button>
	    		</div>
    		</div>
			)
	}

}
const likeLine={
	'display':'flex',
	'justifyContent':'space-around'
}

